import { useContext } from "react";
import { Box, Button } from "@mui/material";
import { AuthContext } from "../context/Auth";


const Game = () => {


    let { data } = useContext(AuthContext);
    console.log(data);
    let newData = data;
    console.log(newData);


    return (
        <Box>
        {newData.map((data) => (
            <Box>{data}</Box>
        ))}
        <Button>Next Question</Button>
    </Box>
    );
}

export default Game;
